      height_l=\"680\" width_l=\"1024\" pathalias=\"\" is_primary=\"0\" has_comment=\"0\">\n\t\t<description>The
      Zebra lives in close-knit groups called families or harems, led by a single
      male. There can be up to 17 members in each family. Everybody in the family
      relies on each other to look out for danger and help those who are in trouble.
      They stay close to each other even when they migrate in herds of 10,000 or more.
      They slow their pace for weak or young members and never leave them. They can
      live to be 28 years old\n\nUnlike Gr\xE9vy&#039;s and Mountain Zebras, Grant&#039;s
      Zebra are not endangered. However, recent civil wars and political conflicts
      in the African countries near their habitats have caused regional extinction.
      Zebra are also killed for their coats or to eliminate competition with domestic
      livestock.\n\nThere may be some 300,000 Grant\u2019s Zebra left in the wild,
      on the Serengeti-Mara Plains alone there are an estimated 150,000 Plains Zebras.
      During the rainy season in the Serengeti, aggregate herds of up to 10,000 individuals
      may form, part of one of the last great wildlife spectacles in the world.\n</description>\n\t</photo>\n\t<photo
