      height_l=\"575\" width_l=\"1024\" pathalias=\"\" is_primary=\"0\" has_comment=\"0\">\n\t\t<description>Serengeti
      National Park\nTanzania\nEast Africa\n\nWildebeest can be seen behind the zebra,
      and in the far distance you can see impalas.  \n\nThe plains zebra (Equus quagga),
      also known as the common zebra, or locally as the &amp;quot;quagga&amp;quot;
      is the most common and geographically widespread species of zebra. It ranges
      from the south of Ethiopia through East Africa to as far south as Botswana and
      eastern South Africa. The plains zebra remains common in game reserves, but
      is threatened by human activities such as hunting for its meat and hide, as
      well as competition with livestock and encroachment by farming on much of its
      habitat.\n\nThe plains zebra is a highly social species, forming harems with
      a single stallion, several mares and their recent offspring; there are also
      bachelor groups. Groups may come together to form herds. The animals keep watch
      for predators rather than attempting to hide; they bark or snort when they see
      a predator, and the harem stallion attacks predators to defend his harem. The
      species population is stable and not endangered, though some populations such
      as in Tanzania have declined sharply. \u2013 Wikipedia</description>\n\t</photo>\n\t<photo
