      height_l=\"683\" width_l=\"1024\" pathalias=\"zulbaning\" is_primary=\"0\" has_comment=\"0\">\n\t\t<description>Rufous-Collared
      Kingfisher, Actenoides concretus, Pekaka Rimba Besar\nNear threatened species
      that can be found in forest area of SouthEast Asia. This is Kingfisher no 10
      in my collection of Kingfisher shots, no 189 in bird species collection. A big
      forest Kingfisher that can be found in Malaysia, Brunei, Indonesia, Myanmar,
      Singapore, and Thailand. This species prefer to stay inside thick forest areas,
      close to water bodies or streams. As other kingfishers this species is highly
      territorial birds, and they will locate a prime area based on food sources,
      desirable perching trees and safe roosting sites. As good as its name, this
      well-known fish hunter also feed on various arthropods such as insects and large
      scorpions, snails, small snakes, and lizards. They will hunt their prey by diving
      from a low perch to snatch the prey off the water surface or off the ground.\n</description>\n\t</photo>\n\t<photo
