      has_comment=\"0\">\n\t\t<description>Gros-bec casse-noyaux m\xE2le (Coccothraustes
      coccothraustes), Neuch\xE2tel, Suisse.\nAvec son bec massif, le gros-bec d\xE9veloppe
      une force \xE9tonnante qui lui permet de casser des noyaux de cerises, de prunelles
      et de prunes m\xFBres tomb\xE9s \xE0 terre. Sa nourriture est en majorit\xE9
      v\xE9g\xE9tarienne. Il mange des fruits et noyaux, en fin d&#039;hiver et au
      printemps, aussi des bourgeons et en \xE9t\xE9 des insectes. Il utilise un Petit
      territoire et niche souvent accompagn\xE9 voire en colonies. En hiver, ils sont
      souvent en troupes. En \xE9t\xE9, il se tient principalement dans la couronne
      des arbres, donc difficile \xE0 observer. Le gros-bec niche dans toute l&#039;Europe,
      presque toute l&#039;Asie (sauf l&#039;Asie du Sud-est) Une partie de l\u2019Afrique
      au Maghreb, en \xC9gypte, en Libye, et niche \xE9galement en Alaska.</description>\n\t</photo>\n\t<photo
