      height_l=\"689\" width_l=\"1024\" pathalias=\"kedleson\" is_primary=\"0\" has_comment=\"0\">\n\t\t<description>When
      I was little, my grandfather would let me help him feed the birds in his backyard.
      \ He made numerous birdhouses and mounted them on fence posts.  We would go
      out together and pour the seeds in each house.  That memory somewhat faded over
      the years until recently.  I have become to love watching the birds, feeding
      them, and if I am lucky, trying to photograph them.  Hummingbirds are rather
      elusive and I have not been successful with a nice capture but  I have found
      that while blue jays are noisy and aggressive to other birds,  they love peanuts
      and will come right up to me and pose.</description>\n\t</photo>\n\t<photo id=\"51179299508\"
