      height_l=\"614\" width_l=\"1024\" pathalias=\"itza\" is_primary=\"0\" has_comment=\"0\">\n\t\t<description>El
      denominado Tri\xE1ngulo de Coral,  es un \xE1rea mar\xEDtima tropical situada
      en el Pac\xEDfico incluye aguas de seis pa\xEDses: Indonesia, Malasia, Pap\xFAa
      Nueva Guinea, Islas Filipinas, Islas Salom\xF3n y Timor Oriental. \nLos arrecifes
      de coral son el hogar de gran biodiversidad marina, proveen alimentos y generan
      ingresos para las comunidades vecinas.Los cient\xEDficos dicen que ciertos corales
      indonesios pueden ofrecer una pista sobre c\xF3mo combatir los efectos del calentamiento
      global.\nSignifica que tal como afirman los ocean\xF3grafos, todav\xEDa tenemos
      tiempo para salvar algunos arrecifes de coral a trav\xE9s de la orientaci\xF3n
      cient\xEDfica de la acci\xF3n de la conservaci\xF3n..\nLa ubicaci\xF3n del arrecife
      en el coraz\xF3n del Tri\xE1ngulo de Coral hace que sea el hogar de la mayor
      biodiversidad marina del planeta, con m\xE1s especies que en todo el Caribe.
      Por esta raz\xF3n, es de particular inter\xE9s para los cient\xEDficos que esperan
      revertir el impacto del calentamiento global en la vida submarina y en la decoloraci\xF3n
      de los corales.\n\n&lt;a href=&quot;https://www.flickr.com/photos/itza/50601590861/in/album-72157664059122102/&quot;&gt;www.flickr.com/photos/itza/50601590861/in/album-721576640...&lt;/a&gt;\n</description>\n\t</photo>\n\t<photo
