      height_l=\"768\" width_l=\"1024\" pathalias=\"\" is_primary=\"0\" has_comment=\"0\">\n\t\t<description>Grey
      seals come to shore at various sites across the UK coastline, in seal terms
      these are known as haul out sites.  Anytime between September and November,
      female grey seals will haul out in preparation for the breeding season. A female
      will normally have just one pup which will stay with its mother for around three
      weeks. As the pup does not have an insulating layer of blubber yet, it is born
      in a fluffy white fur known as lanugo. This keeps the pup nice and warm whilst
      learning from its mum during its first few weeks of life. It will normally shed
      the fur between 27-29 days after birth when they then moult into an adult pelage,
      or what we\u2019d more commonly refer to as a coat.</description>\n\t</photo>\n\t<photo
