      has_comment=\"0\">\n\t\t<description>Today&#039;s edition of Armchair Traveling
      takes me back to our trip to The Galapagos Islands. We landed on a couple of
      different islands where we found evidence on the beach of sea turtle nests -
      and, unfortunately, the hatchlings that didn&#039;t make it all the way to the
      ocean. The females lay many eggs in a sandy depression that they have scooped
      out well above the surfline. When the babies hatch, they have to scuttle across
      the sand, sometimes hundreds of feet to reach the ocean against very long odds.
      We saw numerous ones that didn&#039;t make it...\n</description>\n\t</photo>\n\t<photo
